//pragma solidity >=0.4.25 <0.6.0;
pragma solidity >=0.4.24 <0.6.0;

import './ERC20/StandardToken.sol';
import './ownership/Ownable.sol';
//import './ERC20/BasicToken.sol';
contract DonToken is StandardToken  {

    string public constant name = "DonateToken";
    string public constant symbol = "DONe";
    uint8 public constant decimals = 18;

    uint8 private percentserverfee;
    uint8 private exchangeETHpercent;
    
    uint256 private minimumsendeth;

    uint256 public constant INITIAL_SUPPLY = 10000000000 * (10 ** uint256(decimals));
    /*
    uint public INITIAL_SUPPLY = 21000000000;
    string public name = 'DonateToken';
    string public symbol = 'ANG';
    uint8 public decimals = 8;
    */
    address owner;
    address servermanager;
     
    struct ExchangeUserInfo {
  
        address    user;
        uint256    token;
       
    }

    mapping(uint256 => ExchangeUserInfo) ExchangeUserQueue;
    uint256 first = 1;
    uint256 last = 0;
    //ExchangeUserInfo[] public ExchangeUserList;

    
    event ev_DonateWithMessage(address indexed _sender , string _message , uint256 _value , uint256 _token);
    event ev_RequestExchangeToETH(address indexed _sender, uint256 _value , uint _id);
    event ev_PopExchangeUserFirst(address indexed _sender, uint256 _value, uint256 _exchangevalue ,  uint256 _id);
    //address owner; owanble 에서 처리가 된다?
    bool public tradeYN = true;
    
    constructor() public {
        totalSupply_ = INITIAL_SUPPLY;
        balances[msg.sender] = INITIAL_SUPPLY;
        percentserverfee = 20; // 수수료
        exchangeETHpercent = 30; //토큰을 다시 ETHER 로 가져갈시 이득 %
        minimumsendeth = 5000000000000000;  //0.005 ether , 5000000 gwei , 5000000000000000 wei
        owner = msg.sender;
        servermanager = msg.sender;
        //owner = msg.sender;  owanble 에서 처리가 된다?
        emit Transfer(address(0), msg.sender, INITIAL_SUPPLY);
    } 

 
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    function GetOwner() public view returns (address) {
        // super.balanceOf(_owner);
        return owner;
    }

    function Getpercentserverfee() public onlyOwner view returns (uint8) {
        // super.balanceOf(_owner);
        return percentserverfee;
    }

    function Setpercentserverfee(uint8 percent) public onlyOwner returns (bool){  //Only Owner
        percentserverfee = percent;
    }

    function GetexchangeETHpercent() public onlyOwner view returns (uint8) {
        // super.balanceOf(_owner);
        return exchangeETHpercent;
    }

    function SetexchangeETHpercent(uint8 percent) public onlyOwner returns (bool){  //Only Owner
        exchangeETHpercent = percent;
    }




    function GetServerManager() public view onlyOwner returns (address) {
        // super.balanceOf(_owner);
        return servermanager;
    }

    function ChangeServerManager(address _newmanager) public onlyOwner returns (bool) {
        require(_newmanager != address(0));
        servermanager = _newmanager;
    }

    
    function balanceOf(address _owner) public view returns (uint256) {
        return super.balanceOf(_owner);
        //return balances[_owner];
    }

    function DonateWithMessage(string message) external payable {
       // require(!closed);

        // require msg.value 0 이상 추가
        require(msg.value >= minimumsendeth); // 최소 기부 eth가 넘어야 한다 
        uint256 amount = msg.value;
       
        //uint256 tokencnt = amount.div(10); // 받은 ether 에 10 뺴서 토큰을 줄까 했는데 그냥 줘도될듯?
        uint256 tokencnt = amount;

        // token 준다
        
        //token.TokenAdd(msg.sender  , tokencnt);
        //transferfromowner(msg.sender , tokencnt);
        AddTokenToDonator(msg.sender , tokencnt);
        //token.transfertoken(msg.sender , tokencnt); // 토큰 준다  owner 가 갖고있는 토큰 주려는데 왜 안되는가
        //token.transferFrom(contractowner , msg.sender , tokencnt); // 토큰 준다  owner 가 갖고있는 토큰 주려는데 왜 안되는가
        //token.approve(contractowner , tokencnt);

        //token.transferFrom(contractowner , msg.sender , tokencnt);

        uint256 serverfee = (amount * percentserverfee) / 100;  // 수수료 30% 먹는다 
        
        servermanager.transfer(serverfee); // 수수료 owner 에 전송
        
        emit ev_DonateWithMessage( msg.sender , message , msg.value , tokencnt);
    }

    /*
    function tokenadd(address _to , uint256 _value) public returns (bool) {
        balances[_to] += _value;
        return true;
    }
    *?
    /*
    function tokenminus(_to, _value);(address _to , uint256 _value) public returns (bool) {
        balances[_to] -= _value;
        return true;
    }
    */
     function transfer(address to, uint256 value) public returns (bool) {
        //emit Transfer(msg.sender, to, value);
        super.transfer(to, value);
    }
    
    /* token 을 owner 에서 전달 */
    /*
    function transferfromowner(address _to, uint256 _value) private returns (bool) {
        require(_value <= balances[owner]);
        require(_to != address(0));

        balances[owner] = balances[owner].sub(_value);
        balances[_to] = balances[_to].add(_value);
        emit Transfer(owner, _to, _value);
    
    }
    */
    /* 토큰을 그냥 증가 */
    function AddTokenToDonator(address _to, uint256 _value) private returns (bool) {
        //require(_value <= balances[owner]);
        require(_value > 0);
        require(_to != address(0));

        //balances[owner] = balances[owner].sub(_value);
        balances[_to] = balances[_to].add(_value);
        emit Transfer(address(this), _to, _value);
    
    }

    function RequestExchangeToETH(uint256 _value) public returns (bool) {

        require(_value > 0); //신청한 token 이 최소 몇 이상은 되야 하는가? 
        require(_value <= balances[msg.sender]); //신청한 사람이 갖고있는 token 이 신청한 _value 토큰 보다 커야 한다

        ExchangeUserInfo memory exinfo = ExchangeUserInfo(msg.sender, _value);

        //enqueue
        
        last += 1;
        ExchangeUserQueue[last] = exinfo;

        transfer(owner , _value);

        emit ev_RequestExchangeToETH(msg.sender, _value , last);

    }
    
    
    function GetExchangeUser(uint _id) public view onlyOwner returns (address , uint256) {
        return (ExchangeUserQueue[_id].user , ExchangeUserQueue[_id].token);

    }

    //교환 신청한 array 총 길이 리턴
    function GetExchangeUserLastIdx() public view onlyOwner returns (uint256) {
        return last;

    }

    function GetExchangeUserFirstIdx() public view onlyOwner returns (uint256) {
        return first;

    }

    function GetExchangeUserFirst() public view onlyOwner returns (address , uint256) {
      return (ExchangeUserQueue[first].user , ExchangeUserQueue[first].token);
   }

    function GetExchangeUserLast() public view onlyOwner returns (address , uint256) {
      return (ExchangeUserQueue[last].user , ExchangeUserQueue[last].token);
   }

    function PopExchangeUserFirst() public onlyOwner returns (address , uint256){  //Only Owner 해야한다
        require(last >= first);  // non-empty queue
        
        ExchangeUserInfo memory exinfo = ExchangeUserQueue[first];
        //data = ExchangeUserQueue[first];

        
        uint256 exchangeETH = exinfo.token  + (exinfo.token * exchangeETHpercent) / 100;  // 수수료 30% 먹는다 

        exinfo.user.transfer(exchangeETH);
        // data  user , token 으로 user 에 contract 에있는 ether 전송
        delete ExchangeUserQueue[first];
        first += 1;
        
        emit ev_PopExchangeUserFirst(exinfo.user, exinfo.token , exchangeETH , first);
        return (exinfo.user , exinfo.token);
        //return ExchangeUserList;
   }


    /*
    function RequestExchangeToETH(uint256 _value) public returns (bool) {

      require(_value > 0); //신청한 token 이 최소 몇 이상은 되야 하는가? 
      require(_value <= balances[msg.sender]); //신청한 사람이 갖고있는 token 이 신청한 _value 토큰 보다 커야 한다

      ExchangeUserInfo memory exinfo = ExchangeUserInfo(msg.sender, _value);
      uint id = ExchangeUserList.push(exinfo);
     
      transfer(owner , _value);

      emit ev_RequestExchangeToETH(msg.sender, _value , id);

    }
    */
    // 교환 신청한 해당 유저 struct array 리턴
    /*
    function GetExchangeUser(uint _id) public view returns (address , uint256) {
        return (ExchangeUserList[_id].user , ExchangeUserList[_id].token);

    }

    //교환 신청한 array 총 길이 리턴
    function GetExchangeUserMaxLength() public view returns (uint) {
        return ExchangeUserList.length;

    }
    
   
   function GetExchangeUserFirst() public view returns (address , uint256) {
      return (ExchangeUserList[0].user , ExchangeUserList[0].token);
   }

    function GetExchangeUserLast() public view returns (address , uint256) {
      return (ExchangeUserList[ExchangeUserList.length-1].user , ExchangeUserList[ExchangeUserList.length-1].token);
   }

   function PopExchangeUser() public returns (address , uint256){
      address addruser = ExchangeUserList[ExchangeUserList.length-1].user;
      uint tokenuser = ExchangeUserList[ExchangeUserList.length-1].token;
      delete ExchangeUserList[ExchangeUserList.length-1];
      ExchangeUserList.length--;
      return (addruser , tokenuser);
      //return ExchangeUserList;
   }

   function PopExchangeUserFirst() public returns (address , uint256){
      address addruser = ExchangeUserList[0].user;
      uint tokenuser = ExchangeUserList[0].token;
      delete ExchangeUserList[0];
      ExchangeUserList.length--;
      return (addruser , tokenuser);
      //return ExchangeUserList;
   }
*/
