    //교환 신청한 모든 유저 리스트
   function GetExchangeUserAll()  public view returns (ExchangeUserInfo[]) {
      return ExchangeUserList;
   }
*/

     function getNowDonateValue() public returns(uint256) {
        return   address(this).balance;
    }

    
    
    function allowance(address _owner, address spender) public  view returns (uint256) { //onlyTradeY
        super.allowance(_owner, spender);
    }

    function transferFrom(address from, address to, uint256 value) public  returns (bool) { //onlyTradeY
        super.transferFrom(from, to, value);
    }

    function approve(address spender, uint256 value) public  returns (bool) { //onlyTradeY
        super.approve(spender, value);
    }
    
    
